INSERT INTO `blogs` (`nid`, `ntitle`, `description`, `postby`, `datepost`, `photo`, `video`) VALUES
(4, 'What is paragraph?', '                <span class=\"BxUVEf ILfuVd\" lang=\"en\"><span class=\"hgKElc\">A paragraph is defined as “<b>a group of sentences or a single sentence that forms a unit</b>”\r\n (Lunsford and Connors 116). Length and appearance do not determine \r\nwhether a section in a paper is a paragraph. For instance, in some \r\nstyles of writing, particularly journalistic styles, a paragraph can be \r\njust one sentence long.</span></span>', 'joss', 'Nov-22-2024', NULL, NULL),
(8, 'what is news in journalism?', '                                <span><span>In journalism, news is <mark class=\"QVRyCf\">information about current events</mark>.</span><span> </span></span><span><span>It can cover a wide range of topics, including government, politics, health, the economy, and the environment.</span><span> </span></span><span><span>The purpose of news is to inform the public about important events so they can make informed decisions.</span><span class=\"UV3uM\"></span></span>', 'joss', 'Nov-22-2024', NULL, NULL);
