INSERT INTO `vacancy` (`vid`, `vposition`, `post`, `postby`, `datepost`, `photo`, `expire`) VALUES
(11, 'Director', ' Paraphrasing means expressing someone else’s ideas or thoughts in your \nown words while maintaining the original meaning. It can make your text \nmore concise, clear, and suitable for a specific audience. Paraphrasing \nis an important skill in both academic writing and professional \ncommunication.', 'joss', 'Nov-22-2024', NULL, '2024-11-30'),
(13, 'System Admin', '<div class=\"kb-article-styles\">\n                <p>A paraphrasing tool is an AI-powered solution to help\n you quickly reword text by replacing certain words with synonyms or \nrestructuring sentences. A paraphraser is ideal for rephrasing articles,\n essays, and various types of content, making the rewriting process \nseamless and effective.</p>\n\n            </div>', 'joss', 'Nov-22-2024', NULL, '2024-11-23'),
(17, 'Manager', ' <div class=\"kb-article-styles\">\n                <p>Our paraphraser can also help with longer passages \n(up to 125 words per input). Upload your document or copy your text into\n the input field.</p>\n<p>With one click, you can reformulate the entire text.</p>\n\n            </div>', 'joss', 'Nov-22-2024', NULL, '2024-11-29');
